import React from 'react'
import { useState } from 'react';

const SignUp = ({backBtn, Login}) => {
    const [details, setDetails] = useState({name: "", password: ""});

    const submitHandler = e => {
        e.preventDefault();
        Login(details);
    }

    return (
        <form className='signUpForm'>
            <div className='signUpFormUser form-group'>
                <label>Username</label>
                <input className='form-control' type='text' placeholder='Enter Username' onChange={e => setDetails({...details, name: e.target.value})} value={details.name}></input>
            </div>
            <div className='signUpPass form-group'>
                <label>Password</label>
                <input className='form-control' type='password' placeholder='Enter Password'></input>
            </div>
            <div className='signUpConfirm form-group'>
                <label>Confirm Password</label>
                <input className='form-control' type='password' placeholder='Confirm Password'></input>
            </div>
            <div className='buttonContainerTwo'>
                <button onClick={backBtn} type="button" className="button-75 buttonsSign1" role="button" to="/signIn"><span class="text">Back</span></button>
                <button onClick={console.log('')} type="submit" className="button-75 buttonsSign2" role="button" to="/signIn"><span class="text">Enter</span></button>
            </div>



        </form>


    )
}

export default SignUp
